import React from 'react';

// Components
import Search from '../components/Search';

// CSS
import styles from './index.module.css';

const App = () => {
    return (
        <div className={styles.container}>
            <section className={styles.content}>
                <h1 className={styles['Search-title']}>
                    Simetrik Search
                </h1>
                <Search />
            </section>
        </div>
    );
};

export default App;
